#include <bits/stdc++.h>using namespace std;const int N = 200005;int tree[4*N];int val[N];void push(int idx){	tree[idx] = tree[idx*2]+tree[idx*2+1];}void build(int idx,int l,int r){	if(l==r) {		tree[idx]=1;		return ;	}	int mid = (l+r)/2;	build(idx*2,l,mid);	build(idx*2+1,mid+1,r);	push(idx);}void update(int idx,int l,int r,int pos){	if(l==r) {		tree[idx]=0;		return;	}	int mid = (l+r)/2;	if(pos<=mid) update(idx*2,l,mid,pos);	else update(idx*2+1,mid+1,r,pos);	push(idx);}int query(int idx,int l,int r,int k){//binary search	if(l==r)	return l;	int mid = (l+r)/2;	if(tree[idx*2]>=k) return query(idx*2,l,mid,k);	else return query(idx*2+1,mid+1,r,k-tree[idx*2]);}int main(){	int n;	cin>>n;	build(1,1,n);	for(int i=1;i<=n;i++) cin>>val[i];	for(int i=0;i<n;i++){		int num;		cin>>num;		int pos = query(1,1,n,num);		cout << val[pos] << " ";		update(1,1,n,pos);	}}